import React from 'react';
import {
    VictoryBar,
    VictoryChart,
    VictoryLine,
    VictoryPie,
  } from "victory";

const UserDetails = ({user}) => {
    return(
        <VictoryChart>
            <VictoryBar
                data={[
                { x: "lizard", y: 1234 },
                { x: "snake", y: 2048 },
                { x: "crocodile", y: 2600 },
                { x: "alligator", y: 9000 },
                ]}
            />
            <VictoryPie
                data={[
                    { x: "lizard", y: 1234 },
                    { x: "snake", y: 2048 },
                    { x: "crocodile", y: 2600 },
                    { x: "alligator", y: 9000 },
                ]}
                />
        </VictoryChart>
    )
}
export default UserDetails;
